import React from "react";

import './footer.css';
import logo from '../../images/PHS-logo.svg';

const Footer = () => {
    return (
        <div className='footer'>
            <div className="footer__line"></div>
            <img src={logo} alt="logo"/>
        </div>
    )
};

export default Footer;
